  return (
    <>
      <Card style={{ width: 200, height: 135 }}>
        <Card.Img
          variant="top"
          src={logo}
          style={{ border: "0.8px solid #E0E0E5", height: 135, width: 150 }}
        />
      </Card>
      <p>Product Detail</p>
    </>
  );
}
